        expect(elem).toHaveText('Example Domain')
    })
    it('Assert attribute', () => {
        browser.url('https://devexpress.github.io/testcafe/example/')
        const element = $('#submit-button')
        element.waitForExist()
        expect(element).toHaveAttrContaining('type', 'submit') 
